import React from 'react';
import styled from 'styled-components';

const Content = styled.div`
  padding-bottom: 50px; /* Adjust this value to create space between content and footer */
`;

const Footer = () => {
  return (
    <FooterContainer>
      <p>&copy; 2024 Track BTC Price</p>
    </FooterContainer>
  );
};

const FooterContainer = styled.footer`
  position: absolute;
  bottom: 0;
  width: 100%;
  padding: 10px;
  text-align: center;
  background-color: #282c34;
  color: #61dafb;
`;

export default function App() {
  return (
    <div>
      <Content>
        {/* Your content here */}
      </Content>
      <Footer />
    </div>
  );
}
